import './App.css';
import TextField from "@material-ui/core/TextField"
import {useState} from "react"

function App() {

  const [todo, setTodo] = useState("");
  return (
    <div className="App">
      <h3>What todo?</h3>
      <TextField 
        className="inputTask" 
        id="standard-basic" 
        label="Write a task" v
        ariant="standard" 
        onChange={(e) => {setTodo(e.target.value)}}
      />
    </div>
  );
}

export default App;
